function eachMinute(){var n=(new Date).getTime(),t=document.getElementsByClassName("timing");[].forEach.call(t,function(t){var r=new Date(t.getAttribute("data-timing")),i=Math.ceil((r-n)/6e4);i>60?(t.innerHTML="",t.classList.remove("alert-warning"),t.classList.remove("alert-danger"),t.style.display="none"):i>=2?(t.classList.add("alert-warning"),t.classList.remove("alert-danger"),t.innerHTML=`Deze film begint over ${i} minuten.`,t.style.display=null):i>=-1?(t.classList.add("alert-warning"),t.classList.remove("alert-danger"),t.innerHTML=`Deze film begint nu.`,t.style.display=null):(t.classList.remove("alert-warning"),t.classList.add("alert-danger"),t.innerHTML=`Deze film is al ${-i} minuten bezig.`,t.style.display=null,i<-30&&t.closest("tr").remove())})}var time=new Date,secondsRemaining=(60-time.getSeconds())*1e3;setTimeout(function(){setInterval(eachMinute,6e4);eachMinute()},secondsRemaining);window.addEventListener("load",function(){eachMinute()});